import './null.scss';
import './header.scss';
import { Link } from 'react-router-dom';
import { AiOutlineHeart } from "react-icons/ai";
import { BsPerson } from "react-icons/bs";
import { BsBag } from "react-icons/bs";



export const Header = (props) => {
   return (
      <header className="header">
         <Link className="logo" to='/' alt='logo'>
            <img src='./img/logo.png' alt='logo' />
            <p>Книжная лавка</p>
         </Link>
         <nav>
            <ul className="menu">
               <li><Link to='/' alt='книги'>книги</Link></li>
               <li><Link href='#' alt='аудиокниги'>аудиокниги</Link></li>
               <li><Link href='#' alt='канцтовары и подарки'>канцтовары и подарки</Link></li>
               <li><Link href='#' alt='блог'>блог</Link></li>
               <li><Link to='/aboutUs' alt='о нас'>о нас</Link></li>
            </ul>
         </nav>
         <div className="profile">
            
<BsPerson className="profileIcon" onClick ={props.onClickEnter}/>


<AiOutlineHeart className="profileIcon" onClick ={props.onClickFavorite} />

<BsBag className="profileIcon" onClick ={props.onClickDrawer} />



         </div>
      </header>
   )
}
